(30, 12, 'Foolshope', 'Foolshope is a medium sized town in the south of Vuswil. It\'s a place often visited by sailors to entertain themselves\r\nGambling is the largest business in town and how most sailors lose their new found coin.'),
(31, 12, 'Society', 'The city is ruled by a single family, the Montagus who profits off of the rampant gambling and sex work in the city.\r\nMost of the people there are only staying for a short while, being sailors. Those who live there are usually quite poor, unable\r\nto leave the city, being trapped in the system. The richer area is closer to the city centre where the institutions are.'),
(32, 12, 'History', 'The city was founded by the Montagu family on top of the treasures of a dragon that had its home in the area\r\nFoolshope is still ruled by the Montagu family to this day. {{William Montagu} Montagu Family}, who is in charge\r\nof security and the initial plot starter to campaign 2, {{Krea Montagu}}, who runs the city\r\nand {{Maurits Montagu}} who runs the harbour.'),
(33, 12, 'Locations', 'Lady Luck Montagu Casino: It\'s a casino owned and operated by the Montagu family.\r\n\r\nSafe Lady: Local inn in the eastern part of the city. The place, the party uses to sleep\r\n\r\nTemple of Ephios; Goddess of love: It\'s essentially a brothel. Dreni is a regular at this establishment\r\n\r\nEntrance Towers: Instead of gates, Foolshope has 2 usually, heavily guarded towers in front of the city.\r\n\r\nTemple of Maara; Goddess of Luck.\r\n\r\nKalte Spinne: Local Tavern\r\n\r\nVuswil bar: Vuswil\'s chain of taverns; not very popular among locals. '),
(34, 27, 'Montagu Family', 'The montagus are a wealthy family of drows who founded the city of Foolshope, 3 of the siblings currently rule over the city. '),
